import { Tab, Tabs } from '@mui/material'
import React, { useState } from 'react'

const TabbarTest = () => {
    const [value,setValue] = useState()
  return (
    <div>
        <Tabs 
        // indicatorColor="secondary" 
        // textColor="secondary"
        value={value} 
        onClick={(e,val)=>setValue(val)}>
            <Tab label="first"/>
            <Tab label="second"/>
            <Tab label="third"/>
        </Tabs>
    </div>
  )
}

export default TabbarTest
